import React, {useEffect, useState} from 'react';
import axios from "axios";

const StagePartner = (data) => {
    const [dataPart,setData]=useState([])
    useEffect(() => {
        axios.get('http://127.0.0.1:8000/partners/partner/?partId='+data.data).then((res)=>setData(res.data))

    }, []);
    return (
        <div className="flex-col justify-start items-start inline-flex">
            <div
                className="w-[230px] h-[78px] px-2.5 pt-2.5 rounded-[20px] border border-stone-900 flex-col justify-start items-center flex">
                <div
                    className="self-stretch justify-start items-center gap-1.5 inline-flex">
                    <div className="justify-start items-center flex">
                        <img
                            className="w-[60px] h-[60px] rounded-[100px] border-2 border-neutral-950"
                            src={"http://127.0.0.1:8000/img/?path="+dataPart[0].partner_logo}/>
                    </div>
                    <div
                        className="grow shrink basis-0 text-black text-lg font-normal font-['Sora'] leading-[27px]">{dataPart[0].partner_name}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default StagePartner;
